import './Welcome.css';


function Welcome(props){
    return (
      <div className='welcomebackdrop'>
        <div className='welcomemodal'>
          <h1>Welcome to Terralogic-meet</h1>
          <button className='welcomebutton'>Okay</button>
        </div>
      </div>
    );
}
export default Welcome;
